import React from 'react';

export default function Hero(){
    return(
        <div className = "photo-container">
            <img className = "photo-container-image-1" alt = "Gathering" src = "https://www.traveldailymedia.com/assets/2019/11/airbnb-experiences-cooking.jpg"></img>
            <img className = "photo-container-image-2" alt = "Cooking" src = "https://a0.muscache.com/im/pictures/57364e42-2689-4051-b35f-0ea6ecb75c7d.jpg?im_w=720"></img>
            <img className = "photo-container-image-3" alt = "Violin and Guitar" src = "https://news.airbnb.com/wp-content/uploads/sites/4/2020/04/673724_Airbnb_00006-2.jpg?fit=2500%2C1406"></img>
            <img className = "photo-container-image-4" alt = "Piano" src = "https://images.squarespace-cdn.com/content/v1/59050b54b3db2ba7eafde083/1504813681228-RW7HV9GECP2PR2OK1MVN/Mexico+Condesa+Aparment-3.jpg?format=1000w"></img>
            <img className = "photo-container-image-5" alt = "Swimming"></img>
            <img className = "photo-container-image-6" alt = "Meditation"></img>
            <img className = "photo-container-image-7" alt = "Singin"></img>
        </div>
    )
}
